import React from 'react';
import { Routes, Route, Link, useNavigate } from 'react-router-dom';
import { useAuth } from './contexts/AuthContext';

// Page Components
import LoginPage from './pages/LoginPage';
import DashboardPage from './pages/DashboardPage';
import StudentManagementPage from './pages/StudentManagementPage';
import AttendanceEntryPage from './pages/AttendanceEntryPage';
import AttendanceViewPage from './pages/AttendanceViewPage';
import NotFoundPage from './pages/NotFoundPage'; // Create a simple 404 page

// Protected Route Component
import ProtectedRoute, { RoleProtectedRoute } from './components/ProtectedRoute'; // Import RoleProtectedRoute if using

function App() {
    const { isAuthenticated, logout, user } = useAuth();
    const navigate = useNavigate();

    const handleLogout = () => {
        logout();
        navigate('/login'); // Redirect to login after logout
    };

    return (
        <div className="App">
            <nav style={{ padding: '1rem', backgroundColor: '#eee', marginBottom: '1rem' }}>
                <Link to="/" style={{ marginRight: '1rem' }}>Home</Link>
                {isAuthenticated && (
                    <>
                        <Link to="/dashboard" style={{ marginRight: '1rem' }}>Dashboard</Link>
                        <Link to="/students" style={{ marginRight: '1rem' }}>Students</Link>
                        <Link to="/attendance/entry" style={{ marginRight: '1rem' }}>Mark Attendance</Link>
                        <Link to="/attendance/view" style={{ marginRight: '1rem' }}>View Attendance</Link>
                        <span style={{ marginRight: '1rem' }}>Welcome, {user?.username} ({user?.role})</span>
                        <button onClick={handleLogout}>Logout</button>
                    </>
                )}
                {!isAuthenticated && (
                    <Link to="/login" style={{ marginRight: '1rem' }}>Login</Link>
                )}
            </nav>

            <main style={{ padding: '1rem' }}>
                <Routes>
                    {/* Public Route */}
                    <Route path="/login" element={<LoginPage />} />

                    {/* Protected Routes */}
                    <Route element={<ProtectedRoute />}> {/* Wrap protected routes */}
                        <Route path="/" element={<DashboardPage />} /> {/* Default to Dashboard if logged in */}
                        <Route path="/dashboard" element={<DashboardPage />} />
                        <Route path="/students" element={
                            <RoleProtectedRoute allowedRoles={['admin', 'teacher']}>
                                 <StudentManagementPage />
                             </RoleProtectedRoute>
                        } />
                         <Route path="/attendance/entry" element={
                            <RoleProtectedRoute allowedRoles={['admin', 'teacher']}>
                                <AttendanceEntryPage />
                            </RoleProtectedRoute>
                         } />
                         <Route path="/attendance/view" element={
                             <RoleProtectedRoute allowedRoles={['admin', 'teacher']}>
                                <AttendanceViewPage />
                             </RoleProtectedRoute>
                         } />
                        {/* Add more protected routes here */}
                    </Route>

                    {/* Catch-all Not Found Route */}
                    <Route path="*" element={<NotFoundPage />} />
                </Routes>
            </main>
        </div>
    );
}

export default App;

